import React, {useState} from "react";
import Footer from "./Footer";
import { useHistory } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { chargeBasic, chargePremium, addItemPremium, addItemBasic } from "../actions";
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import CheckCircleIcon from '@material-ui/icons/CheckCircle';
import amaLogo from "../images/ama-rewards-logo.png";
import { Dropdown } from "react-bootstrap";
import RepairItemMenu from "./RepairItemMenu";
import RepairItem from "./RepairItem";

function Payment(props) {
    const plan = useSelector(state => state.plan);
    const price = useSelector(state => state.price);
    const renewal = useSelector(state => state.renewal)
    const discount = useSelector(state => state.discount);
    const dispatch = useDispatch();
    const history = useHistory();
    const [isMouseOver, setMouseOver] = useState(false);
    const [buttonDisplay, setButtonDisplay] = useState(false);
    const [actionText, setActionText] = useState("Add");

    const [items, setItems] = useState([]);

    const customerInfo = props.location;

    function addItem (newItem) {
        setItems((prevItems) => {
            return [...prevItems, newItem];
        });
        if ({plan}.plan === "Premium") {
            dispatch(addItemPremium());
        } else if ({plan}.plan === "Basic") {
            dispatch(addItemBasic());
        }
    }

    function deleteItem(id) {
        setItems((prevItems) => {
            return prevItems.filter((item, index) => {
                return index !== id;
            });
        });
    }

    function handleClick() {
        setButtonDisplay(true);

        if (actionText === "Add") {
            setActionText("Remove");
        } else {
            setActionText("Add");
            setButtonDisplay(false);
        }
    }

    return (
    <div className="page-container">
        <h1 className="page-header">Payment Information</h1>
        <div className="top-section">
            <div className="info-summary">
                <h1>{plan}</h1>
                <p>Name: <strong>{customerInfo.state.name.customerName}</strong></p>
                <p>Phone Number: <strong>{customerInfo.state.phone.phoneNumber}</strong></p>
                <p>License Plate: <strong>{customerInfo.state.license.licensePlate}</strong></p>
                <p>Vehicle: <strong>{customerInfo.state.vehicle.vehicleInfo}</strong></p>
            </div>
            <div className="ama">
                <button
                    className="ama-add" onClick={handleClick}
                    >{actionText} <img className="ama-logo" src={amaLogo} alt="ama-rewards-logo" />
                </button>
                {buttonDisplay === true && (
                <div>
                    <label className="ama-label">AMA Number</label>
                        <input type="number" placeholder="620XXXXXXXXXXXXX" className="ama-input"/>
                    <div className="ama-verify">
                    <button
                        className="ama-check">Check AMA Status
                    </button>
                    <CheckCircleIcon fontSize="large" className="ama-status"></CheckCircleIcon>
                    </div>
                </div>
                )}
            </div>
        </div>
        <div className="mid-section">
            <div className="repair-item-section">
            <RepairItemMenu
                onAdd={addItem}
            />
            {items.map((item, index) => {
                return (
                    <RepairItem
                        key={index}
                        id={index}
                        itemName={item}
                        onDelete={deleteItem}
                    />
                );
            })}
            </div>
            <div className="detail-summary-section">
                <div className="payment-detail">Details go here</div>
            </div>
        </div>
        <button
            className="back-button"
            onClick={() => history.push("/info")}>
            <ArrowBackIcon></ArrowBackIcon>
        </button>
        <Footer />
    </div>
    )
}

export default Payment;
